import React from 'react'
import styled from 'styled-components'

function Navbar() {
  return (
    <Container>
    <Inner>

    <Logo>

        <img src="logotry1.jpg"/>
    </Logo>


    <SearchBar>
        <input type="text" placeholder='search here......'/>
        <SearchIcon>
            <img src="search.png" alt="" />
        </SearchIcon>
    </SearchBar>

    <RightContainer>
        <NavButton>
            <p>Hello</p>
            <p>Guests</p>
        </NavButton>
    </RightContainer>
    </Inner>
    </Container>
  )
}


const Container=styled.div`
    width:100%;
    height:60px;
    background-color:#131921;
    display:flex;
    align-items:center;
    position:relative;

`;

const Inner =styled.div`
    width:100%;
    display:flex;
    align-items:center;

`;

const Logo =styled.div`
    margin-left:20px;
    cursor:pointer;
    img{
        width:100px;
        margin-top:10px;

    }
`;

const SearchBar=styled.div`
    height:35px;
    // flex=1 means it covers emplty entire space
    flex:1;
    margin:0px 15px;
    display:flex;
    align-items:center;
    border-radius:0px 5px 5px 0px;

    input{
        flex:1;
        width:100%;
        height:100%;
        border:none;
        border-radius:5px 0px 0px 5px;

        &::placeholder{
            padding-left:5px;
        }
    }

`;


const RightContainer =styled.div``;

const SearchIcon =styled.div`
    background-color:#feb069;
    height:100%;
    width:40px;
    display:flex;
    align-items:center;
    justify-content:center;

    img{
        width:22px;
       
    }
`;

const NavButton =styled.div`

`;
export default Navbar
